Entry.block.arduino_convert_scale = function(c, b) {
  var e = b.getNumberValue("VALUE1", b), d = b.getNumberValue("VALUE2", b), f = b.getNumberValue("VALUE3", b);
  c = b.getNumberValue("VALUE4", b);
  b = b.getNumberValue("VALUE5", b);
  if (d > f) {
    var g = d, d = f, f = g;
  }
  c > b && (g = c, c = b, b = g);
  e = (b - c) / (f - d) * (e - d);
  e += c;
  e = Math.min(b, e);
  e = Math.max(c, e);
  return Math.round(e);
};
